package jsp.main.model.vo;

public class DescriptionTb {
	private String desImagePath;
	private String desAttention;
	private String desRefund;
	private String desAccount;
	private String desMainView;
	private String desPensionAbout;
	private String desRoom;
	private String desEtc;
	public DescriptionTb() {
		super();
		// TODO Auto-generated constructor stub
	}
	public DescriptionTb(String desImagePath, String desAttention, String desRefund, String desAccount,
			String desMainView, String desPensionAbout, String desRoom, String desEtc) {
		super();
		this.desImagePath = desImagePath;
		this.desAttention = desAttention;
		this.desRefund = desRefund;
		this.desAccount = desAccount;
		this.desMainView = desMainView;
		this.desPensionAbout = desPensionAbout;
		this.desRoom = desRoom;
		this.desEtc = desEtc;
	}
	public String getDesImagePath() {
		return desImagePath;
	}
	public void setDesImagePath(String desImagePath) {
		this.desImagePath = desImagePath;
	}
	public String getDesAttention() {
		return desAttention;
	}
	public void setDesAttention(String desAttention) {
		this.desAttention = desAttention;
	}
	public String getDesRefund() {
		return desRefund;
	}
	public void setDesRefund(String desRefund) {
		this.desRefund = desRefund;
	}
	public String getDesAccount() {
		return desAccount;
	}
	public void setDesAccount(String desAccount) {
		this.desAccount = desAccount;
	}
	public String getDesMainView() {
		return desMainView;
	}
	public void setDesMainView(String desMainView) {
		this.desMainView = desMainView;
	}
	public String getDesPensionAbout() {
		return desPensionAbout;
	}
	public void setDesPensionAbout(String desPensionAbout) {
		this.desPensionAbout = desPensionAbout;
	}
	public String getDesRoom() {
		return desRoom;
	}
	public void setDesRoom(String desRoom) {
		this.desRoom = desRoom;
	}
	public String getDesEtc() {
		return desEtc;
	}
	public void setDesEtc(String desEtc) {
		this.desEtc = desEtc;
	}
	
}
